scriptlet.script:
var re = /^Valid ([0-9]) key\(s\) detected - ([0-9]+)$/;
var result = [];
var status = JSON.parse(programProperties)['keyValidation'];
if( status !== undefined && status.trim() !== "" && (result = re.exec(status)) !== null ) {
    var count = parseInt(result[1]);
    var filename = folder + '\\' + result[2] + '.pub';
    scriptletContext.put("count",count);
    scriptletContext.put("filename",filename);
    scriptletResponse="Yes";
}
else {
    scriptletResponse="No";
}

var pr = scriptletContext.get("RS_Previous_Response");
try{
	switch(pr) {
		case "more items":
			if(output.trim().length > 0) {
				scriptletContext.put("keysSet",output);
			}
			scriptletResponse = "more";
		break;

		case "no more items":
			scriptletResponse = "complete";
		break;

		case udefined:
			throw new Error("Datatabse Error:" + output);
		break;
	}
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}

try {
	var sql = "update ENA_ACTIVE_LABS set KEYS = '" + content + "' where REQUEST = '" + requestId + "'";
	scriptletResult = sql;
	scriptletContext.put("SQL",sql);
	scriptletResponse = "success";
}
catch(Error) {
	scriptletResponse = "failure";
	scriptletContext.put("FailureMessage",Error);
}

if(keysToUpdate === keysSet) {
	scriptletResponse="continue";
}
else {
	var i = parseInt(Iteration);
	if(i > parseInt(Max)) {
		scriptletResponse="failure";
	}
	else {
		i++;
		scriptletContext("Iteration",i);
		scriptletResponse="sleep";
	}
}
